import { article,brand,cta,feature,navbar} from "./components";
import {footer,whatGPT3,possibility,header,feautures,blog} from "./container";
import './App.css';
import './index.css';

const App = () => {
  render (
    <div className="App">
        <div className="gradient__bg">
         <navbar />
         <header />
        </div>
        <brand />
        <whatGPT3 />
        <features />
        <possibility />
        <cta />
        <blog />
        <footer />
    </div>
  )
}

export default App;
